import React from 'react';

const Results = (props) => {
    return (
        <ul>
        {props.items.map((item) => {
            return (<Item key={this.item.id} 
                    onClick={this.removeItem(item.id)


            }/>)})
        }
        </ul>
    )
}

export default Results;
